import React from "react";
import { Container, Row, Col } from "react-bootstrap";
import "./Clients.css";
import img1 from "./Clientsimg/1.png";
import img2 from "./Clientsimg/2.png";
import img3 from "./Clientsimg/3.png";
import img4 from "./Clientsimg/4.png";
import img5 from "./Clientsimg/5.png";
import img6 from "./Clientsimg/6.png";
import img7 from "./Clientsimg/7.png";
import img8 from "./Clientsimg/8.png";
import img9 from "./Clientsimg/9.png";
import img10 from "./Clientsimg/10.png";

function Clients() {
  return (
    <div>
      <Container>
        <Row className="client-row1">
          <Col lg={2} className="client-col1">
            <img src={img1} alt="" className="clientimg1" />
          </Col>
          <Col lg={2} className="client-col1">
            <img src={img2} alt="" className="clientimg1" />
          </Col>
          <Col lg={2} className="client-col1">
            <img src={img3} alt="" className="clientimg1" />
          </Col>
          <Col lg={2} className="client-col1">
            <img src={img4} alt="" className="clientimg1" />
          </Col>
          <Col lg={2} className="client-col1">
            <img src={img5} alt="" className="clientimg1" />
          </Col>
        </Row>
        <Row className="client-row1">
          <Col lg={2} className="client-col1">
            <img src={img1} alt="" className="clientimg1" />
          </Col>
          <Col lg={2} className="client-col1">
            <img src={img2} alt="" className="clientimg1" />
          </Col>
          <Col lg={2} className="client-col1">
            <img src={img3} alt="" className="clientimg1" />
          </Col>
          <Col lg={2} className="client-col1">
            <img src={img4} alt="" className="clientimg1" />
          </Col>
          <Col lg={2} className="client-col1">
            <img src={img5} alt="" className="clientimg1" />
          </Col>
        </Row>
      </Container>
    </div>
  );
}
export default Clients;
